import { withStyles } from "@material-ui/core/styles";

export default withStyles(theme => {
  const { colors } = theme.palette;

  return {
    container: {
      display: "flex",
      flexDirection: "column",
      justifyContent: "center"
    },
    socialLinkContainer: {
      position: "absolute",
      bottom: 0,
      left: 40
    }
  };
});
